import React from "react";

export default class ImageCard extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { description, urls } = this.props.image;
    return (
      <div>
        <img alt={description} src={urls.regular} />
      </div>
    );
  }
}
